<?php
	/**
	 * A string containing Unicode 2.0.14 code points.
	 */
	class UnicodeString implements ArrayAccess, Countable, Iterator {
		const LETTER = "L";
		const LETTER_LOWERCASE = "Ll";
		const LETTER_MODIFIER = "Lm";
		const LETTER_OTHER = "Lo";
		const LETTER_TITLECASE = "Lt";
		const LETTER_UPPERCASE = "Lu";
		const MARK = "M";
		const MARK_ENCLOSING = "Me";
		const MARK_NON_SPACING = "Mn";
		const MARK_SPACING_COMBINING = "Mc";
		const NUMBER = "N";
		const NUMBER_DECIMAL_DIGIT = "Nd";
		const NUMBER_LETTER = "Nl";
		const NUMBER_OTHER = "No";
		const OTHER = "C";
		const OTHER_CONTROL = "Cc";
		const OTHER_FORMAT = "Cf";
		const OTHER_NOT_ASSIGNED = "Cn";
		const OTHER_PRIVATE_USE = "Co";
		const OTHER_SURROGATE = "Cs";
		const PUNCTUATION = "P";
		const PUNCTUATION_CLOSE = "Pe";
		const PUNCTUATION_CONNECTOR = "Pc";
		const PUNCTUATION_DASH = "Pd";
		const PUNCTUATION_FINAL_QUOTE = "Pf";
		const PUNCTUATION_INITIAL_QUOTE = "Pi";
		const PUNCTUATION_OPEN = "Ps";
		const PUNCTUATION_OTHER = "Po";
		const SEPARATOR = "Z";
		const SEPARATOR_LINE = "Zl";
		const SEPARATOR_PARAGRAPH = "Zp";
		const SEPARATOR_SPACE = "Zs";
		const SYMBOL = "S";
		const SYMBOL_CURRENCY = "Sc";
		const SYMBOL_MATH = "Sm";
		const SYMBOL_MODIFIER = "Sk";
		const SYMBOL_OTHER = "So";
		private static $map = null;
		private static $packedMap = "";
		private $contents = array();
		private $pointer = 0;

		public function __construct () {
			if (!self::$map) {
				self::$map = unserialize(gzuncompress(base64_decode(self::$packedMap)));
			}
			foreach (func_get_args() as $cp) {
				$this->offsetSet(null, $cp);
			}
		}

		/**
		 * @return array
		 */
		public function analyzeCategories () {
			$result = array();
			foreach ($this->contents as $cp) {
				$result[$this->findChar($cp)->GeneralCategory][$this->codePointToUtf8($cp)] = true;
				ksort($result[$this->findChar($cp)->GeneralCategory]);
			}
			ksort($result);
			return array_map("array_keys", $result);
		}

		/**
		 * @param UnicodeString $pString
		 * @return UnicodeString
		 */
		public function concatenate (UnicodeString $pString) {
			$result = new UnicodeString();
			$result->contents = array_merge($this->contents, $pString->contents);
			return $result;
		}

		/**
		 * @param int $pCodePoint
		 * @return int|null
		 */
		public function indexOf ($pCodePoint) {
			$pos = array_search($pCodePoint, $this->contents, true);
			return $pos === false ? null : $pos;
		}

		/**
		 * @return int
		 */
		public function count () {
			return count($this->contents);
		}

		/**
		 * @return int|null
		 */
		public function current () {
			return $this->valid() ? $this->contents[$this->pointer] : null;
		}

		/**
		 * Decomposes every character in the string by splitting it into the base character and
		 * diacritic marks or into multiple base characters for ligatures.
		 * @param bool $pIsZealous When set to true, also inofficial or former ligatures will be
		 *                         split (e. g. Æ and ß), although there are is no decomposition map
		 *                         specified by Unicode. 
		 * @return UnicodeString
		 */
		public function decompose ($pIsZealous = false) {
			$contents = array();
			foreach ($this->contents as $cp) {
				$mapping = null;
				if ($cp >= 0x80 && ($char = $this->findChar($cp))) {
					if ($char->CharacterDecompositionMapping) {
						$mapping = $char->CharacterDecompositionMapping;
					} else if ($pIsZealous && preg_match('/^LATIN (CAPITAL|SMALL) LETTER (\w) WITH STROKE$/', $char->CharacterName, $matches)) {
						$matches = array_map($matches[1] == 'SMALL' ? 'strtolower' : 'strtoupper', $matches);
						$mapping = sprintf('%04x %s', ord($matches[2]), substr($char->Unicode10Name, -6) == ' SLASH' ? '0337' : '0335');
					}
				}
				if ($mapping) {
					foreach (explode(" ", $mapping) as $cp2) {
						if (strlen($cp2) == 4 && hexdec($cp2) > 0) {
							$contents[] = hexdec($cp2);
						}
					}
				}
				else if (!$pIsZealous) {
					$contents[] = $cp;
				}
				else if ($cp === 0xc6) { // Æ
					$contents[] = 0x41;
					$contents[] = 0x45;
				}
				else if ($cp === 0xdf) { // ß => ss
					$contents[] = 0x73;
					$contents[] = 0x73; // 0x7a // = z
				}
				else if ($cp === 0xe6) { // æ
					$contents[] = 0x61;
					$contents[] = 0x65;
				}
				else if ($cp === 0x152 || $cp === 0x276) { // Œ / ɶ
					$contents[] = 0x4f;
					$contents[] = 0x45;
				}
				else if ($cp === 0x153) { // œ
					$contents[] = 0x6f;
					$contents[] = 0x65;
				}
				else if ($cp === 0x195) { // ƕ
					$contents[] = 0x68;
					$contents[] = 0x76;
				}
				else if ($cp === 0x1a2) { // Ƣ
					$contents[] = 0x68;
					$contents[] = 0x76;
				}
				else if ($cp === 0x1a3) { // ƣ
					$contents[] = 0x68;
					$contents[] = 0x76;
				}
				else if ($cp === 0x1a6) { // Ʀ
					$contents[] = 0x59;
					$contents[] = 0x72;
				}
				else if ($cp === 0x26e) { // ɮ
					$contents[] = 0x6c;
					$contents[] = 0x292;
				}
				else if ($cp === 0x2a3) { // ʣ
					$contents[] = 0x64;
					$contents[] = 0x7a;
				}
				else if ($cp === 0x2a4) { // ʤ
					$contents[] = 0x64;
					$contents[] = 0x292;
				}
				else if ($cp === 0x2a5) { // ʥ
					$contents[] = 0x64;
					$contents[] = 0x291;
				}
				else if ($cp === 0x2a6) { // ʦ
					$contents[] = 0x74;
					$contents[] = 0x73;
				}
				else if ($cp === 0x2a7) { // ʧ
					$contents[] = 0x74;
					$contents[] = 0x283;
				}
				else if ($cp === 0x2a8) { // ʨ
					$contents[] = 0x74;
					$contents[] = 0x255;
				}
				else {
					$contents[] = $cp;
				}
			}
			$result = new UnicodeString();
			$result->contents = $contents;
			if ($contents !== $this->contents) {
				$result = $result->decompose();
			}
			return $result;
		}

		/**
		 * @param null|UnicodeString $pChars
		 * @param array              $pCategories
		 * @param int                $pReplaceBy
		 * @return UnicodeString
		 */
		public function filter (UnicodeString $pChars = null, array $pCategories = array(), $pReplaceBy = null) {
			$contents = array();
			$pCategories = array_map("strtolower", $pCategories);
			foreach ($this->contents as $cp) {
				$char = $this->findChar($cp);
				$cat = strtolower($char->GeneralCategory);
				if ($pChars && $pChars->indexOf($cp) !== null
					|| in_array($cat, $pCategories) || in_array($cat[0], $pCategories)
				) {
					$contents[] = $cp;
				}
				else if (is_int($pReplaceBy) && $pReplaceBy >= 0 && $pReplaceBy <= 0x10ffff) {
					$contents[] = $pReplaceBy;
				}
			}
			$result = new UnicodeString();
			$result->contents = $contents;
			return $result;
		}

		/**
		 */
		public function next () {
			$this->pointer++;
		}

		/**
		 * @return int
		 */
		public function key () {
			return $this->valid() ? $this->pointer : 0;
		}

		/**
		 * @param string $pString
		 * @return bool
		 */
		public function loadUtf8String ($pString) {
			$this->rewind();
			$this->contents = array();
			for ($i = 0; $i < strlen($pString); $i++) {
				$fb = ord($pString[$i]);
				if ($fb < 0x80) {
					$this->contents[] = $fb;
				}
				else if ($fb < 0xc2) {
					return false;
				}
				else if ($fb < 0xe0) {
					$sb = ord($pString[++$i]);
					if ($sb >= 0x80 && $sb < 0xc0) {
						$this->contents[] = ($fb & 0x1f) << 6 | $sb & 0x3f;
					}
					else {
						return false;
					}
				}
				else if ($fb < 0xe1) {
					$sb = ord($pString[++$i]);
					$tb = ord($pString[++$i]);
					if ($sb >= 0xa0 && $sb < 0xc0 && $tb >= 80 && $tb < 0xc0) {
						$this->contents[] = ($fb & 0xf) << 12 | ($sb & 0x3f) << 6 | $tb & 0x3f;
					}
					else {
						return false;
					}
				}
				else if ($fb < 0xed) {
					$sb = ord($pString[++$i]);
					$tb = ord($pString[++$i]);
					if ($sb >= 0x80 && $sb < 0xc0 && $tb >= 80 && $tb < 0xc0) {
						$this->contents[] = ($fb & 0xf) << 12 | ($sb & 0x3f) << 6 | $tb & 0x3f;
					}
					else {
						return false;
					}
				}
				else if ($fb < 0xee) {
					return false;
				}
				else if ($fb < 0xf0) {
					$sb = ord($pString[++$i]);
					$tb = ord($pString[++$i]);
					if ($sb >= 0x80 && $sb < 0xc0 && $tb >= 80 && $tb < 0xc0) {
						$this->contents[] = ($fb & 0xf) << 12 | ($sb & 0x3f) << 6 | $tb & 0x3f;
					}
					else {
						return false;
					}
				}
				else if ($fb < 0xf1) {
					$sb = ord($pString[++$i]);
					$tb = ord($pString[++$i]);
					$lb = ord($pString[++$i]);
					if ($sb >= 0x90 && $sb < 0xc0 && $tb >= 80 && $tb < 0xc0
						&& $lb >= 80 && $lb < 0xc0
					) {
						$this->contents[] = ($fb & 0x7) << 18 | ($sb & 0x3f) << 12
							| ($tb & 0x3f) << 6 | $lb & 0x3f;
					}
					else {
						return false;
					}
				}
				else if ($fb < 0xf4) {
					$sb = ord($pString[++$i]);
					$tb = ord($pString[++$i]);
					$lb = ord($pString[++$i]);
					if ($sb >= 0x80 && $sb < 0xc0 && $tb >= 80 && $tb < 0xc0
						&& $lb >= 80 && $lb < 0xc0
					) {
						$this->contents[] = ($fb & 0x7) << 18 | ($sb & 0x3f) << 12
							| ($tb & 0x3f) << 6 | $lb & 0x3f;
					}
					else {
						return false;
					}
				}
				else if ($fb < 0xf5) {
					$sb = ord($pString[++$i]);
					$tb = ord($pString[++$i]);
					$lb = ord($pString[++$i]);
					if ($sb >= 0x80 && $sb < 0x90 && $tb >= 80 && $tb < 0xc0
						&& $lb >= 80 && $lb < 0xc0
					) {
						$this->contents[] = ($fb & 0x7) << 18 | ($sb & 0x3f) << 12
							| ($tb & 0x3f) << 6 | $lb & 0x3f;
					}
					else {
						return false;
					}
				}
				else {
					return false;
				}
			}
			return true;
		}

		/**
		 * @param int|null $pOffset
		 * @return bool
		 */
		public function offsetExists ($pOffset) {
			return $pOffset > 0 && $pOffset < $this->count();
		}

		/**
		 * @param int $pOffset
		 * @return int|null
		 */
		public function offsetGet ($pOffset) {
			return $this->offsetExists($pOffset) ? $this->contents[$pOffset] : null;
		}

		/**
		 * @param int $pOffset
		 * @param int $pValue
		 */
		public function offsetSet ($pOffset, $pValue) {
			$pValue = (int) $pValue;
			if ($pOffset === null) {
				$this->contents[] = $pValue;
			}
			else if ($pOffset >= 0 && $pValue >= 0 && $pValue <= 0x10ffff) {
				$diff = $pOffset - $this->count() + 1;
				if ($diff > 0) {
					$this->contents = array_merge($this->contents, array_fill(0, $diff, 0));
				}
				$this->contents[$pOffset] = $pValue;
			}
		}

		/**
		 * @param int $pOffset
		 */
		public function offsetUnset ($pOffset) {
			unset($this->contents[$pOffset]);
			$this->contents = array_values($this->contents);
			if ($pOffset >= $this->pointer) {
				$this->pointer--;
			}
		}

		/**
		 */
		public function rewind () {
			$this->pointer = 0;
		}

		/**
		 * @return string
		 */
		public function saveUtf8String () {
			$result = "";
			foreach ($this->contents as $cp) {
				$result .= $this->codePointToUtf8($cp);
			}
			return $result;
		}

		/**
		 * @param int           $pOffset
		 * @param int           $pLength
		 * @param UnicodeString $pReplacement
		 * @return UnicodeString
		 */
		public function splice ($pOffset, $pLength = 0, UnicodeString $pReplacement = null) {
			if ($pOffset < 0) {
				$pOffset += $this->count();
			}
			if ($pLength < 0) {
				$pLength += $this->count() - $pOffset;
			}
			if ($this->pointer > $pOffset + $pLength) {
				$this->pointer += count($pReplacement) - $pLength;
			}
			else if ($this->pointer >= $pOffset) {
				$this->pointer = $pOffset - 1;
			}
			$result = new UnicodeString();
			$result->contents = array_splice(
				$this->contents,
				$pOffset,
				$pLength,
				$pReplacement ? $pReplacement->contents : null
			);
			return $result;
		}

		/**
		 * @return UnicodeString
		 */
		public function toLowerCase () {
			$result = new UnicodeString();
			foreach ($this->contents as $cp) {
				$char = $this->findChar($cp);
				$result[] = $char->LowercaseMapping ? hexdec($char->LowercaseMapping) : $cp;
			}
			return $result;
		}

		/**
		 * @return UnicodeString
		 */
		public function toUpperCase () {
			$result = new UnicodeString();
			foreach ($this->contents as $cp) {
				$char = $this->findChar($cp);
				$result[] = $char->UppercaseMapping ? hexdec($char->UppercaseMapping) : $cp;
			}
			return $result;
		}

		/**
		 * @return bool
		 */
		public function valid () {
			return $this->pointer < $this->count();
		}

		/**
		 * @param int $pCodePoint
		 * @return stdClass
		 */
		private function findChar ($pCodePoint) {
			if (isset(self::$map[$pCodePoint])) {
				return self::$map[$pCodePoint];
			}
			$last = null;
			foreach (self::$map as $cp => $char) {
				if ($cp > $pCodePoint) {
					return self::$map[$last];
				}
				$last = $cp;
			}
			return self::$map[0xe000]; // private use
		}

		/**
		 * @param int $pCodePoint
		 * @return string
		 */
		private function codePointToUtf8 ($pCodePoint) {
			if ($pCodePoint < 0x80) {
				return chr($pCodePoint);
			}
			else if ($pCodePoint < 0x800) {
				return chr($pCodePoint >> 6 | 0xc0) . chr($pCodePoint & 0x3f | 0x80);
			}
			else if ($pCodePoint < 0x10000) {
				return chr($pCodePoint >> 12 | 0xe0) . chr(($pCodePoint >> 6) & 0x3f | 0x80)
					. chr($pCodePoint & 0x3f | 0x80);
			}
			else {
				return chr($pCodePoint >> 18 | 0xf0) . chr(($pCodePoint >> 12) & 0x3f | 0x80)
					. chr(($pCodePoint >> 6) & 0x3f | 0x80) . chr($pCodePoint & 0x3f | 0x80);
			}
		}
	}
